import React, { Component } from 'react';
import './css/bootstrap.min.css';
import './App';

class Login extends Component {
  render() {
    return (
      <div className="body">
      <h3>Please Sign in</h3>
        <form id="loginform" method="post">
            <div className="form-group">
                <input type="text" className="form-control" placeholder="User Name" name="user" id="user" />
                <div className="input-group">
                    <input className="form-control login-password" type="password" className="form-control" placeholder="Password" name="pwd" id="pwd" />
                </div>
            </div>
            <div className="form-group">
                <input type="submit" className="btn btn-lg btn-success btn-block" id="chk"  value="Login" />
            </div>
            </form>
            <hr />
            <button id="signup" className="btn btn-sm btn-default collapse" type="button">Sign Up</button>&nbsp; <button id="recover" className="btn btn-sm btn-warning" type="button">Password Recovery</button>
        <hr />
    </div>
    );
  }
}

export default Login;
